import { Injectable } from '@angular/core';
import { InMemoryDbService } from 'angular-in-memory-web-api';
import { User } from './REGapi/models';

@Injectable({
  providedIn: 'root',
})
export class InMemoryUsers implements InMemoryDbService {

  createDb() {
    const users: User[] = [
      {
        name: 'Anatoly',
        login: 'ana@example.com',
        password: '123'
      },
      {
        name: 'Vasya',
        login: 'vas@example.com',
        password: '123'
      },
      {
        name: 'Bob',
        login: 'bob@example.com',
        password: '123'
      },
      {
        name: 'Kolya',
        login: 'kolya@example.com',
        password: '123'
      },
    ];


    return { users };
  }
}
